<!DOCTYPE html>
<html>
<head>
  <link href="https://fonts.googleapis.com/css?family=Share+Tech+Mono&display=swap" rel="stylesheet">
  <link rel="stylesheet" type="text/css" href="style.css" >
  <script src="bundle.js"></script>
</head>
<body>
<div class="ui">
    <input type="text" name="title-input">
    <hr>
    <div class="key-element" data-state="dangerous">
        <svg class="key-icon" viewBox="0 0 134 116">
            <use href="#hexagon-icon" fill="#CCCCCC"></use>
            <use href="#dangerous-icon"></use>
        </svg>
        <span class="key-text">dangerous sector</span>
    </div>
    <div class="key-element" data-state="secure">
        <svg class="key-icon" viewBox="0 0 134 116">
            <use href="#hexagon-icon" fill="#FFFFFF" stroke="#000000"></use>
            <use href="#secure-icon"></use>
        </svg>
        <span class="key-text">secure sector</span>
    </div>
    <div class="key-element" data-state="alien-start">
        <svg class="key-icon" viewBox="0 0 134 116">
            <use href="#hexagon-icon" fill="#000000" stroke="#FFFFFF"></use>
            <use href="#alien-start-icon" fill="#FFFFFF"></use>
        </svg>
        <span class="key-text">alien start</span>
    </div>
    <div class="key-element" data-state="human-start">
        <svg class="key-icon" viewBox="0 0 134 116">
            <use href="#hexagon-icon" fill="#000000" stroke="#FFFFFF"></use>
            <use href="#human-start-icon" fill="#FFFFFF"></use>
        </svg>
        <span class="key-text">human start</span>
    </div>
    <div class="key-element" data-state="airlock">
        <svg class="key-icon" viewBox="0 0 134 116">
            <use href="#hexagon-icon" fill="#000000" stroke="#FFFFFF"></use>
            <use href="#airlock-icon" fill="#FFFFFF"></use>
        </svg>
        <span class="key-text">airlock</span>
    </div>
    <div class="key-element" data-state="empty">
        <svg class="key-icon" viewBox="0 0 134 116">
            <use href="#hexagon-icon" fill="none" stroke="#FFFFFF"></use>
        </svg>
        <span class="key-text">remove sector</span>
    </div>
    <hr>
    <a href="#" class="save-button">Download map (SVG)</a>
</div>
